import React, { useEffect, useState } from "react";
import './Navbar.css';

  import hart from '../../assets/hart.png'
  import cart from '../../assets/cart.png'
  import logo from '../../assets/logo.png'
  import menu from '../../assets/menu.png'  
  //import home from '../../assets/home.png'
  import account from '../../assets/account.png'
  import hexa from '../../assets/hexa.jpg'
  //import vegcutting from '../../assets/vegcutting.jpg'
  //import iphone from '../../assets/iphon.jpg'
  //import watch from '../../assets/watch.jpg'
  import {useNavigate} from 'react-router-dom'
  import axios from 'axios';
import { setFragrances, setSmartPhone,setSkincare,setGroceries,setHomedecoration,setFurniture,setTops,setWomendress,setWomenshoes } from "../../redux/action";
import { setLaptop } from "../../redux/action";
  import {useDispatch} from 'react-redux'


const Navbar = () => {



  const [apidata,setapidata] = useState([])
  const [productData,setProductData] = useState([])

  const dispatch = useDispatch()
  const dhars = useNavigate();
  const categoryData = async () => {
    const response = await axios.get("https://dummyjson.com/products/categories ")
    setapidata(response.data)
  }

  const pData =async () => {
    const response = await axios.get("https://dummyjson.com/products")
    setProductData(response.data.products)
  }

  const smartPhoneApi = async () => {
    const result = await axios.get("https://dummyjson.com/products/category/smartphones")

    dispatch(setSmartPhone(result.data.products))

  }

  const laptopApi = async () => {
    const result = await axios.get("https://dummyjson.com/products/category/laptops")
    dispatch(setLaptop(result.data.products))
  }

  const fragrancesApi = async () => {
    const result = await axios.get("https://dummyjson.com/products/category/fragrances")
    dispatch(setFragrances(result.data.products))
  }

  const skincareApi = async () => {
    const result = await axios.get("https://dummyjson.com/products/category/skincare")
    dispatch(setSkincare(result.data.products))
  }
  const groceriesApi = async () => {
    const result = await axios.get("https://dummyjson.com/products/category/groceries")
    dispatch(setGroceries(result.data.products))
  }
  const homedecorationApi = async () => {
    const result = await axios.get("https://dummyjson.com/products/category/home-decoration")
    dispatch(setHomedecoration(result.data.products))
  }
  const furnitureApi = async () => {
    const result = await axios.get("https://dummyjson.com/products/category/furniture")
    dispatch(setFurniture(result.data.products))
  }
  const topsApi = async () => {
    const result = await axios.get("https://dummyjson.com/products/category/tops")
    dispatch(setTops(result.data.products))
  }
  const womendressApi = async () => {
    const result = await axios.get("https://dummyjson.com/products/category/womens-dresses")
    dispatch(setWomendress(result.data.products))
  }
  const womenshoesApi = async () => {
    const result = await axios.get("https://dummyjson.com/products/category/womens-shoes")
    dispatch(setWomenshoes(result.data.products))
  }
  const mensshirtssApi = async () => {
    const result = await axios.get("https://dummyjson.com/products/category/mens-shirts")
    dispatch(set(result.data.products))
  }



  

  const navigateCategory = (item) => {
     switch(item) {
      case 'smartphones':     
        smartPhoneApi();
        console.log('smaaarrrrrrrrrrrr')
        dhars("/Smartphone")
        break;

      case 'laptops':
        laptopApi();
        dhars("/Laptop") 
        break;
      
      case 'fragrances' :
        fragrancesApi();
        dhars("/Fragrances")
        break;

      case  'skincare' :  
        skincareApi();
        dhars("/Skincare") 
        break;

      case  'groceries' :  
      groceriesApi();
        dhars("/Groceries")
        break;   

      case 'home-decoration'  :
        homedecorationApi();
        dhars("/Homedecoration")
        break;

      case 'furniture':
        furnitureApi();
        dhars("/Furniture") 
        break;

      case 'tops':
        topsApi();
        dhars("/Tops")
        break;
      
      case 'womens-dresses':
        womendressApi();
        dhars("/Womendress") 
        break;

      case 'womens-shoes':
        womenshoesApi();
        dhars("/Womenshoes")
        break;

     }  
      
  }


  useEffect(()=> {  
   categoryData()
   pData()
  },[])

  

  

  

  const hartt = () => {
    dhars('/Hart') 
  }

  const cartt = () => {
    dhars('/Cart')
  }

  

  
  return (
    <>
      <div className="header">
        <div className="blogo">
        <img style={{width:130,height:70,marginTop:-30,}} src={logo} alt="ss" />
         </div>
        <div className="search">
           <form>
           <select>
              <option>All</option>
              <option>Home and Garden</option>
              <option>Shoes</option>
              <option>Watches</option>
              <option>Electronics components</option>
            </select>
            <input type="text" placeholder="Search for products"></input>
            <button>Go</button><br></br><br></br>
              <a href="/#">Gift Shop</a>&nbsp;&nbsp;
              <a href="/#">Become a seller</a>&nbsp;&nbsp;
              <a href="/#">Special offers</a>&nbsp;&nbsp;
              <a href="/#">Buyer protection</a>
          </form>
        </div> 
        
        <div className="icons">
         
      <img  style={{width:40,height:30,alignItems:"center"}} src={hart} alt="h" onClick={hartt} />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
      <img  style={{width:40,height:30,alignItems:"center"}} src={cart} alt="l" onClick={cartt} />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
      <div className="dicons">
      <img style={{width:40,height:30,alignItems:"center",}} src={account} alt="sss"/>&nbsp;&nbsp;&nbsp;
      <select style={{backgroundColor:"none",outline:"none",border:"none"}}>
      <option>My account</option>
      <option>My order</option>
      <option>My massage</option>
      </select></div>
      </div>
</div>

{/* <div className="categoriess">
<img style={{width:30,height:20,marginTop:-30,paddingLeft:100,paddingTop:100}} src={menu} alt="ss" />&nbsp;
<span style={{paddingTop:68}}>Categories </span>
</div> */}



{/* navbar ke niche ki coding */}
<div className="secpage">
<div className="cat">
<div style={{flexDirection:"row",alignItems:"center",display:'flex',marginTop:60,marginLeft:60}}>
<img style={{width:30,height:30,marginLeft:10}} src={menu} alt="ss"/>&nbsp;&nbsp;
 <b><span>Categories</span></b>
 </div>
 {
